import SkillContainerV1 from "./SkillContainerV1.js";
export default class extends React.Component {
    state = {
        cards: [{
            key: 0,
            title: "Web Development",
            skills: [{ key: 0, value: "React", content:"blah"}, { key: 1, value: "SCSS",content :"aha" }],
        },
        {
            key: 1,
            title: "Personal",
            skills: [{ key: 0, value: "Loving Jaymee" }],
        },
        {
            key: 2,
            title: "Anotha One",
            skills: [{ key: 0, value: ["being big op"] }],
        },
        ],
    }
    render() {
        return (
            <div className ="${card.container}">
                <h1 className="${card.title}">{this.state.cards[0].title}</h1>
                <SkillContainerV1
                    skills={this.state.cards[0].skills}

                />
            </div>
        );
    }
}
